There exist two complex numbers $c$, say $c_1$ and $c_2$, so that $-5 + 3i$, $8 - i$, and $c$ form the vertices of an equilateral triangle.  Find the product $c_1 c_2$.

[asy]
unitsize(0.5 cm);

pair A, B;
pair[] C;

A = (2,2);
B = (5,1);
C[1] = rotate(60,A)*(B);
C[2] = rotate(60,B)*(A);

draw(A--C[1]--B--C[2]--cycle);
draw(A--B);

dot("$-5 + 3i$", A, W);
dot("$8 - i$", B, E);
dot("$c_1$", C[1], N);
dot("$c_2$", C[2], S);
[/asy],116 - 75i

Let $M_n$ be the $n \times n$ matrix with entries as follows: for $1 \le i \le n$, $m_{i,i} = 10$; for $1 \le i \le n - 1$, $m_{i+1,i} = m_{i,i+1} = 3$; all other entries in $M_n$ are zero. Let $D_n$ be the determinant of matrix $M_n$. Find
\[\sum_{n=1}^{\infty} \frac{1}{8D_n+1}.\]Note: The determinant of the $1 \times 1$ matrix $[a]$ is $a$, and the determinant of the $2 \times 2$ matrix $\left[ {\begin{array}{cc}
a & b \\
c & d \\
\end{array} } \right] = ad - bc$; for $n \ge 2$, the determinant of an $n \times n$ matrix with first row or first column $a_1$ $a_2$ $a_3$ $\dots$ $a_n$ is equal to $a_1C_1 - a_2C_2 + a_3C_3 - \dots + (-1)^{n+1}a_nC_n$, where $C_i$ is the determinant of the $(n - 1) \times (n - 1)$ matrix formed by eliminating the row and column containing $a_i$.,\frac{1}{72}

